import { useVideos } from "../../../context/videos-context";
import { VideoCard } from "../../card/video-card";

const History = () => {
  const {videoState, videoDispatch} = useVideos()
  const { videos, history } = videoState
  const historyVideosList = videos.filter
  const historyVideos = historyVideosList.map((item) => (
    <VideoCard key={item._id} videoData={item} />
  ));
  return (
    <div className="flex-r-w space-evenly">
      <div className="history-heading width-100 is-5 bold m-up-5 m-dw-3 text-center">
        {historyVideos}
      </div>
    </div>
  );
};

export { History };
